import styled from 'styled-components';
import { useState } from 'react';
import {
  PageWrapper,
  PageTitle,
  StyledForm,
} from '../../../components/shared/CommonStyles';

export default function RegisterVaccine() {
  const [name, setName] = useState('');
  const [numDoses, setNumDoses] = useState('');
  const [daysDoses, setDaysDoses] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  function submitInput(e) {
    e.preventDefault();
    console.log(name, numDoses, daysDoses);
  }

  return (
    <PageWrapper>
      <SignupWrapper>
        <PageTitle> Cadastrar Vacina </PageTitle>
        <StyledForm onSubmit={submitInput}>
          <label htmlFor="name"> Nome da Vacina: </label>
          <input
            type="name"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
          <label htmlFor="doses"> NÃºmero de Doses: </label>
          <input
            type="text"
            id="doses"
            value={numDoses}
            onChange={(e) => setNumDoses(e.target.value)}
            required
          />
          <label htmlFor="days-doses"> Dias Entre as Doses: </label>
          <input
            type="text"
            id="days-doses"
            value={daysDoses}
            onChange={(e) => setDaysDoses(e.target.value)}
            required
          />
          <input type="submit" disabled={isLoading} value="Cadastrar" />
        </StyledForm>
      </SignupWrapper>
    </PageWrapper>
  );
}

const SignupWrapper = styled.div`
  width: 800px;
`;
